import React, { Component } from 'react'

const token=localStorage.getItem("token")

class MyList extends Component {
    constructor(props){
        super(props)  
        this.state={
        products: [],
        itemcount:"",
        display:false
        }
        } 
componentDidMount() {        
    if(token===null)
    {
      
      this.props.history.push({
           pathname:'/signin'
       })
   }
}
 
    render() {
        return (
            <div className="container">
            <div className="row">
            <div className="col-md-2"></div>
            <div className="col-md-8 p-2" style={{marginBottom:"100px",border:"1px solid #84c225"}}>
            <div className="p-2 text-center" style={{background:"#84c225",}}>
                  Review My List
            </div>
            </div>
            <div className="col-md-2"></div>
             </div>              
            </div>
        )
    }
}

export default MyList
